		--
		-- Housekeeping Variables
		--
		DECLARE @ProcName NVARCHAR(500) = OBJECT_NAME(@@PROCID);
		DECLARE @DebugMsg NVARCHAR(500) = '';
		DECLARE @BatchOverrideID BIGINT = NULL,
				@OverrideStartDate DATE = NULL,
				@OverrideEndDate DATE = NULL;
		DECLARE @MinProcessingDate DATE = (DATEADD(YEAR, DATEDIFF(YEAR, '1900-01-01', GETDATE()) - 7, '1900-01-01'));
		
		--
		IF @DebugMode = 1
			BEGIN
				SELECT @DebugMsg = @ProcName + N' : ' + CONVERT(NVARCHAR(25), GETDATE(), 121) + N' - Starting.';
				RAISERROR (@DebugMsg, 0, 0) WITH NOWAIT;
			END;

		BEGIN TRY;
		 
			IF EXISTS ( SELECT 1 FROM [dbo].[ETLBatchOverride] (NOLOCK) WHERE [TaskName] = @PackageName AND [IsActive] = 1 )
				BEGIN
					SELECT TOP 1
						   @BatchOverrideID = [BatchOverrideID],
						   @OverrideStartDate = [OverrideStartDate],
						   @OverrideEndDate = [OverrideEndDate]
					FROM [dbo].[ETLBatchOverride] (NOLOCK)
					WHERE [TaskName] = @PackageName
					AND [IsActive] = 1
					ORDER BY [CreatedDate] DESC;

					SELECT @IsOverride = 1;
				END;
			ELSE
				BEGIN
					SELECT @IsOverride = 0;
				END;

			DECLARE @ProcessingRange TABLE (
				[FullDate] DATE,
				[FiscalWeekStartDate] DATE,
				[FiscalWeekEndDate] DATE
			);

			IF ((@OverrideStartDate IS NULL) OR (@OverrideEndDate IS NULL))
				BEGIN
					INSERT INTO @ProcessingRange ([FullDate], [FiscalWeekStartDate], [FiscalWeekEndDate])
					SELECT
						[D].[FullDate], [D].[FiscalWeekStartDate], [D].[FiscalWeekEndDate]
					FROM #DimDate [D]
					JOIN [dbo].[ETLBatchEnum] [E] (NOLOCK)
						ON [D].[FullDate] = [E].[FiscalDate]
					WHERE [E].[PackageName] = @PackageName
					AND [E].[ExecutionID] = @ExecutionID;

					IF (@OverrideStartDate IS NOT NULL)
						DELETE @ProcessingRange WHERE [FullDate] < @OverrideStartDate;

					IF (@OverrideEndDate IS NOT NULL)
						DELETE @ProcessingRange WHERE [FullDate] > @OverrideEndDate;
				END;
			ELSE IF ((@OverrideStartDate IS NOT NULL) AND (@OverrideEndDate IS NOT NULL))
				BEGIN
					INSERT INTO @ProcessingRange ([FullDate], [FiscalWeekStartDate], [FiscalWeekEndDate])
					SELECT
						[D].[FullDate], [D].[FiscalWeekStartDate], [D].[FiscalWeekEndDate]
					FROM #DimDate [D]
					WHERE [D].[FullDate] >= @OverrideStartDate
					AND [D].[FullDate] <= @OverrideEndDate;
				END;

			DELETE [dbo].[ETLBatchEnum] WHERE [PackageName] = @PackageName AND [ExecutionID] = @ExecutionID;
			DELETE @ProcessingRange WHERE [FullDate] < @MinProcessingDate OR [FullDate] > CONVERT(DATE, GETDATE());

			IF (@IsOverride = 1)
				BEGIN
					DELETE @ProcessingRange WHERE [FiscalWeekEndDate] IN (
						SELECT [BatchSplitByValue] FROM [dbo].[AuditLog] (NOLOCK) WHERE [ExecutionID] IN (
							SELECT [ExecutionID] FROM [dbo].[ETLBatchOverrideExecutions] (NOLOCK) WHERE [BatchOverrideID] = @BatchOverrideID
						)
					);

					INSERT INTO [dbo].[ETLBatchOverrideExecutions] ([BatchOverrideID], [ExecutionID]) VALUES (@BatchOverrideID, @ExecutionID);
				END;

			SELECT DISTINCT [FiscalWeekStartDate], [FiscalWeekEndDate] FROM @ProcessingRange ORDER BY [FiscalWeekStartDate];
		END TRY
		
		BEGIN CATCH
			IF (@@TRANCOUNT > 0)
				ROLLBACK TRAN;

			--
			-- Raiserror
			--	
			DECLARE @ErrMsg NVARCHAR(4000), @ErrSeverity INT;
			SELECT @ErrMsg = ERROR_MESSAGE(),
				@ErrSeverity = ERROR_SEVERITY();
			RAISERROR(@ErrMsg, @ErrSeverity, 1);

		END CATCH;
